                     <div class="t m0 x20 h6 y8e ff1 fs4 fc0 sc0 ls0 ws0">clicking on Employer Identification<span class="ff5"> </span>Number (EIN) under Starting a </div>
                     <div class="t m0 x20 h6 y8f ff1 fs4 fc0 sc0 ls0 ws0">Business. Go to <span class="ff7">www.irs.gov/Forms </span>to view, download, or print Form </div>
                     <div class="t m0 x20 h6 yf9 ff1 fs4 fc0 sc0 ls0 ws0">W-7 and/or Form SS-4.  Or, you can go to <span class="ff7">www.irs.gov/OrderForms </span>to </div>
                     <div class="t m0 x20 h6 yfa ff1 fs4 fc0 sc0 ls0 ws0">place an order and have Form W-7 and/or SS-4 mailed to you within 10 </div>
                     <div class="t m0 x20 h6 yfb ff1 fs4 fc0 sc0 ls0 ws0">business days.</div>
                     <div class="t m0 x21 h6 y194 ff1 fs4 fc0 sc0 ls0 ws0">If you are asked to complete Form W-9 but do not have a TIN, apply </div>
                     <div class="t m0 x20 h6 y195 ff1 fs4 fc0 sc0 ls0 ws0">for a TIN and write “Applied For” in the space for the TIN, sign and date </div>
                     <div class="t m0 x20 h6 y12d ff1 fs4 fc0 sc0 ls0 ws0">the form, and give it to the requester. For interest and dividend </div>
                     <div class="t m0 x20 h6 y196 ff1 fs4 fc0 sc0 ls0 ws0">payments, and certain payments made with respect to readily tradable </div>
                     <div class="t m0 x20 h6 y197 ff1 fs4 fc0 sc0 ls0 ws0">instruments, generally you will have 60 days to get a TIN and give it to </div>
                     <div class="t m0 x20 h6 y198 ff1 fs4 fc0 sc0 ls0 ws0">the requester before you are subject to backup withholding on </div>
                     <div class="t m0 x20 h6 y199 ff1 fs4 fc0 sc0 ls0 ws0">payments. The 60-day rule does not apply to other types of payments. </div>
                     <div class="t m0 x20 h6 y19a ff1 fs4 fc0 sc0 ls0 ws0">You will be subject to backup withholding on all such payments until </div>
                     <div class="t m0 x20 h6 y9a ff1 fs4 fc0 sc0 ls0 ws0">you provide your TIN to the requester.</div>
                     <div class="t m0 x20 h6 y130 ff5 fs4 fc0 sc0 ls0 ws0">Note: <span class="ff1">Entering “Applied For” means that you have already</span> <span class="ff1">applied for a </span></div>
                     <div class="t m0 x20 h6 y131 ff1 fs4 fc0 sc0 ls0 ws0">TIN or that you intend to apply for one soon.</div>
                     <div class="t m0 x20 h6 y19b ff5 fs4 fc0 sc0 ls0 ws0">Caution: <span class="ff1">A disregarded U.S. entity that has a foreign owner</span> <span class="ff1">must use </span></div>
                     <div class="t m0 x20 h6 y133 ff1 fs4 fc0 sc0 ls0 ws0">the appropriate Form W-8.</div>
                     <div class="t m0 x20 h11 y19c ff5 fs9 fc0 sc0 ls0 ws0">Part II. Certification</div>
                     <div class="t m0 x20 h6 y19d ff1 fs4 fc0 sc0 ls0 ws0">To establish to the withholding agent that you are a U.S. person, or </div>
                     <div class="t m0 x20 h6 ya3 ff1 fs4 fc0 sc0 ls0 ws0">resident alien, sign Form W-9. You may be requested to sign by the </div>
                     <div class="t m0 x20 h6 y19e ff1 fs4 fc0 sc0 ls0 ws0">withholding agent even if item 1, 4, or 5 below indicates otherwise.</div>
                     <div class="t m0 x21 h6 y19f ff1 fs4 fc0 sc0 ls0 ws0">For a joint account, only the person whose TIN is shown in Part I </div>
                     <div class="t m0 x20 h6 y1a0 ff1 fs4 fc0 sc0 ls0 ws0">should sign (when required). In the case of a disregarded entity, the </div>
                     <div class="t m0 x20 h6 y1a1 ff1 fs4 fc0 sc0 ls0 ws0">person identified on line 1 must sign. Exempt payees, see </div>
                     <div class="t m1 x2d h6 y1a1 ff7 fs4 fc0 sc0 ls0 ws0">Exempt<span class="ff1"> </span>payee </div>
                     <div class="t m1 x20 hf y1a2 ff7 fs4 fc0 sc0 ls0 ws0" style="position: inherit; bottom: 173px;">code,</div>
                     <div class="t m0 x2e h6 y1a2 ff7 fs4 fc0 sc0 ls0 ws0"> <span class="ff1">earlier.</span></div>
                     <div class="t m0 x20 h6 y1a3 ff5 fs4 fc0 sc0 ls0 ws0">Signature requirements. <span class="ff1">Complete the certification as indicated</span> <span class="ff1">in </span></div>
